import React from 'react';
import {getImg} from "../utils/helper";

export const CartListProduct = props => {
    const cutImgLink = allname => allname.split("/")[2].split(".")[0];

    return (
        <a href={`/details/${ cutImgLink(props.newBoxBaby.image) }`}>
            <div className='box-light-cart-list'>
                { getImg(props.newBoxBaby.image) } 
                <span>
                    { props.newBoxBaby.name }
                </span>
                <input type={"text"} className="input-counter-cart-list" defaultValue={ props.newBoxBaby.num } />
                <span>
                    { props.newBoxBaby.price }
                </span>
                <button className="btn main-btn-remove">remove</button>
            </div>
        </a>
    );
}
